import './NavBar.css';

function NavBar(){
    return(
        <section className="navbar">
            <section className='navbar-work navbar-item'>
                <button>
                     Work
                </button>
            </section>
            <section className='navbar-contact navbar-item'>
                <button>
                    Contact
                </button>
            </section>
        </section>
    );
}

export default NavBar;
